import React, { Component } from 'react'
import './bloodbank.css';

class Bloodbank extends Component {
    render() {
        return (       
            
            <table class="table">
                <thead>
                    <tr>
                    <p class="text-center">Center aligned text on all viewport sizes.</p>
                    </tr>
                </thead>
            </table>
        )
    }
}

export default Bloodbank;
